        /*
         移动 134,135,136,137,138,139,150,151,152,158,159,157,187,188,147
         联通 130,131,132,155,156,185,186
         电信 133,153,180,189
移动：2G号段（GSM）：134、135、136、137、138、139、150、151、152、158、159；3G号段（TD-SCDMA，G3)：157、187、188、147（上网本）.
联通：2G号段(GSM)：130、131、132、155、156；3G号段(WCDMA，沃-WO)：185、186.
电信：2G号段(CDMA)：133、153；3G号段(CDMA2000，天翼)：180、189.
         * */
        #endregion

        private static Dictionary<int, ChinaAreaInfo> _cache = new Dictionary<int, ChinaAreaInfo>();
        private static Dictionary<int, TelecomMode> _telecomCache = new Dictionary<int, TelecomMode>();

        static MobileParser()
        {
            #region 初始化
            using (StringReader reader = new StringReader(_mapText))
            {
                string line = null;
                while ((line = reader.ReadLine()) != null)
                {
                    string[] data = line.Split('\t');
                    if (data.Length != 2) continue;
                    string provStr = data[0];
                    var provs = ChinaAreaUtil.GetByName(provStr);
                    if (provs == null || provs.Count == 0) continue;
                    string[] ranges = data[1].Split('|');
                    foreach (var range in ranges)
                    {
                        string[] rs = range.Split('-');
                        if (rs.Length != 2) continue;
                        var mr = new MobileRange() { Begin = int.Parse(rs[0]), End = int.Parse(rs[1]) };
                        for (int i = mr.Begin; i <= mr.End; i++)
                        {
                            _cache.Add(i, provs.First());
                        }
                    }
                }
            }
            //移动 134,135,136,137,138,139,150,151,152,158,159,157,187,188,147
            _telecomCache.Add(134, TelecomMode.ChinaMobile);
            _telecomCache.Add(135, TelecomMode.ChinaMobile);
            _telecomCache.Add(136, TelecomMode.ChinaMobile);
            _telecomCache.Add(137, TelecomMode.ChinaMobile);
            _telecomCache.Add(138, TelecomMode.ChinaMobile);
            _telecomCache.Add(139, TelecomMode.ChinaMobile);
            _telecomCache.Add(150, TelecomMode.ChinaMobile);
            _telecomCache.Add(151, TelecomMode.ChinaMobile);
            _telecomCache.Add(152, TelecomMode.ChinaMobile);
            _telecomCache.Add(158, TelecomMode.ChinaMobile);
            _telecomCache.Add(159, TelecomMode.ChinaMobile);
            _telecomCache.Add(157, TelecomMode.ChinaMobile);
            _telecomCache.Add(187, TelecomMode.ChinaMobile);
            _telecomCache.Add(188, TelecomMode.ChinaMobile);
            _telecomCache.Add(147, TelecomMode.ChinaMobile);
            //联通 130,131,132,155,156,185,186
            _telecomCache.Add(130, TelecomMode.ChinaUnicom);
            _telecomCache.Add(131, TelecomMode.ChinaUnicom);
            _telecomCache.Add(132, TelecomMode.ChinaUnicom);
            _telecomCache.Add(155, TelecomMode.ChinaUnicom);
            _telecomCache.Add(156, TelecomMode.ChinaUnicom);
            _telecomCache.Add(185, TelecomMode.ChinaUnicom);
            _telecomCache.Add(186, TelecomMode.ChinaUnicom);
            //电信 133,153,180,189
            _telecomCache.Add(133, TelecomMode.ChinaTelecom);
            _telecomCache.Add(153, TelecomMode.ChinaUnicom);
            _telecomCache.Add(180, TelecomMode.ChinaUnicom);
            _telecomCache.Add(189, TelecomMode.ChinaUnicom);
            #endregion
        }

        /// <summary>
        /// 手机号
        /// </summary>
        public string Mobile { get; private set; }
        
        /// <summary>
        /// 电信运营商类型
        /// </summary>
        public TelecomMode Telecom { get; private set; }
        
        /// <summary>
        /// 省市
        /// </summary>
        public ChinaAreaInfo Province { get; private set; }

        /// <summary>
        /// 构造函数
        /// </summary>
        /// <param name="mobile"></param>
        public MobileParser(string mobile)
        {
            Mobile = mobile;
            Telecom = GetTelecom(mobile);
            Province = GetProvince(mobile);
        }

        /// <summary>
        /// 获取手机号所在运营商
        /// </summary>
        /// <param name="mobile"></param>
        /// <returns></returns>
        public static TelecomMode GetTelecom(string mobile)
        {
            TelecomMode ret = TelecomMode.Unknown;
            if (mobile.Length > 3)
            {
                int key = Convert.ToInt32(mobile.Substring(0, 3));
                if (_telecomCache.ContainsKey(key))
                    ret = _telecomCache[key];
            }
            return ret;
        }

        /// <summary>
        /// 根据手机号获取省信息
        /// </summary>
        /// <param name="mobile"></param>
        /// <returns></returns>
        public static ChinaAreaInfo GetProvince(string mobile)
        {
            if (mobile.Length < 7) return null;
                //throw new ArgumentException("查询省份信息手机号必须提供7位以上号码。");
            var num = int.Parse(mobile.Substring(0, 7));
            return _cache.ContainsKey(num) ? _cache[num] : null;
        }

        internal class MobileInfo : IComparable<MobileInfo>
        {
            public int Mobile { get; set; }
            public string Area { get; set; }

            public int CompareTo(MobileInfo other)
            {
                return this.Mobile.CompareTo(other.Mobile);
            }
        }
        internal class MobileRange
        {
            public int Begin { get; set; }
            public int End { get; set; }
        }
    }

    /// <summary>
    /// 运营商类型
    /// </summary>
    public enum TelecomMode
    {
        /// <summary>
        /// 未知
        /// </summary>
        Unknown,

        /// <summary>
        /// 移动
        /// </summary>
        ChinaMobile,

        /// <summary>
        /// 联通
        /// </summary>
        ChinaUnicom,

        /// <summary>
        /// 电信
        /// </summary>
        ChinaTelecom
    }
